import React from 'react'

function About() {
  return (
    <React.Fragment>

    <h1>
      About
    </h1>
    <p>This is a Todolist app v1.0.0</p>
    <p>Todo List: it help you to keep track of your work and organised you for the day</p>
    </React.Fragment>
  )
}
export default  About;
